import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import "./App.css";

// Default Homepage Component
function Homepage() {
  return (
    <div className="App">
      <header className="App-header">
        <p>Welcome to the Homepage!</p>
        <nav>
          <Link to="/accept">Go to Accept</Link> |{" "}
          <Link to="/decline">Go to Decline</Link>
        </nav>
      </header>
    </div>
  );
}

// Accept Component
function Accept() {
  return (
    <div className="App">
      <header className="App-header">
        <p>You have accepted!</p>
      </header>
    </div>
  );
}

// Decline Component
function Decline() {
  return (
    <div className="App">
      <header className="App-header">
        <p>You have declined!</p>
      </header>
    </div>
  );
}

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Homepage />} />
        <Route path="/accept" element={<Accept />} />
        <Route path="/decline" element={<Decline />} />
      </Routes>
    </Router>
  );
}

export default App;
